import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  container: {
    display: "flex",
    minHeight: "100vh",
    height: "100%",
    flexDirection: "column",
  },
  scrolled: {
    paddingTop: 100,
  },
  webHeader: {
    flex: "0 1 auto",
    height: 50,
  },
  webBlock: {
    flex: "1 1 auto",
    margin: "50px 0",
    width: "100%",
  },
  webFooter: {
    height: 30,
  },
  webContainer: {
    backgroundColor: "#dfdfff",
    padding: "40px 20px",
    borderRadius: 10,
  },
}));

export default useStyles;
